import React from 'react';

function Login() {
    return (
        <div className='login'>
            <img src="https://i.postimg.cc/pLhjpQqV/6.png" alt="image" />
            <form>
                <label for="username"><b>Username</b></label>
                <input type="text" placeholder="Enter Username" name="uname" />
            </form>
        </div>
    )
}

export default Login;
